import React from 'react'
import {Switch,Route} from 'react-router-dom';
import Home from './components/home';

class AsyncComponent extends React.Component{
    constructor(props){
        super(props);
        this.import = props.import;
        this.component = null;
    }

    componentDidMount(){
        this.import.then((component)=>{
            this.component = component;
            this.forceUpdate();
        })
    }

    render(){
        let ComponentToRender = this.component;

        return (
            <React.Fragment>
                {ComponentToRender?<ComponentToRender/>:null}
            </React.Fragment>
        )
    }

}

const asyncLoad = (prom)=>(props)=>(<AsyncComponent {...props} import={prom}/>)

export default (props)=>(
    <Switch>
         <Route exact path="/" component={Home}/>
         <Route path="/about" render={asyncLoad(import('./components/about.js'))}/>
         <Route path="/other" render={asyncLoad(import('./components/other.js'))}/>
    </Switch>
)

